import * as C from './LandingStyling';
import { Link } from 'react-router-dom';

export default function Landing() {
    return (
        <C.container>
            <C.hero>
                <C.button onClick={() => {window.location.replace('http://localhost:8080/play')}}>Get Started</C.button>
            </C.hero>
        </C.container>
    );
}
